// src/components/UserProfileCard.js
import React from 'react';
import { Card, CardHeader, CardContent, Typography } from '@mui/material';

const UserProfileCard = () => {
  return (
    <Card>
      <CardHeader
        title="User Profile"
        subheader="Details"
        // Centering the profile picture
        sx={{ textAlign: 'center' }}
      />
      <CardContent>
        <Typography variant="body1">Name: </Typography>
        <Typography variant="body1">Email: </Typography>
        <Typography variant="body1">Business Type: </Typography>
        <Typography variant="body1">Business Branches: </Typography>
        <Typography variant="body1">Phone Number: +1234567890</Typography>
        <Typography variant="body1">Company: XYZ Corporation</Typography>
        <Typography variant="body1">Expected Credit: $10,000</Typography>
        <Typography variant="body1">Number of Employees: 50</Typography>
      </CardContent>
    </Card>
  );
};

export default UserProfileCard;
